o style Admin user interface\r\n</div>\r\n</div>\r\n<p> </p><br>\r\n<p> </p>','','',NULL),(776,1,2,'Naslovnica','Naslovnica','<div class=\"row\">\r\n    <div class=\"span1\"><img src=\"assets/img/multilangual.png\"></div>\r\n    <div class=\"span3\">\r\n<h4>Prirodna višejezičnost</h4>\r\nPrirodno podržana višejezičnost, bez potrebe za dodacima.\r\nSvaki element može biti preveden i moguće je dodavati jezike po želji.\r\n</div>\r\n    <div class=\"span1\"><img src=\"assets/img/easy_customize.png\"></div>\r\n    <div class=\"span3\">\r\n<h4>Prilagodljiv</h4>\r\nAplikacija bazirana na CodeIgniter PHP frameworku, ako ste upoznati s  CodeIgniterom lako ćete modificirati sustav.\r\n</div>\r\n    <div class=\"span1\"><img src=\"assets/img/bootstrap.png\"></div>\r\n    <div class=\"span3\">\r\n<h4>Bootstrap ugrađen</h4>\r\nAdministracija i klijentska stranica bazirana na Boostrtapu i jednostavna za prilagodbu.\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n    <div class=\"span1\"><img src=\"assets/img/drag-drop.png\"></div>\r\n    <div class=\"span3\">\r\n<h4>Jednostavan<br></h4>\r\nStruktura webstranice jasna.\r\nUpravljanje elementima poput stranica, nekretninama ili slikama jednostavna pomoću drag\'n\'drop!\r\n</div>\r\n    <div class=\"span1\"><img src=\"assets/img/template.png\"></div>\r\n    <div class=\"span3\">\r\n<h4>Sustav predložaka</h4>\r\nJednostavan CodeIgniter Template Parser Class ili alternativna PHP syntax-a podržana.\r\n</div>\r\n    <div class=\"span1\"><img src=\"assets/img/robust.png\"></div>\r\n    <div class=\"span3\">\r\n<h4>Robustan</h4>\r\nRazvijen da buje jednostavan i izgledom robustan, ugrađeno Metro style Admin sučelje\r\n</div>\r\n</div>\r\n<p> </p><br>\r\n<p> </p>','','',NULL),(777,180,1,'Basic categories','Basic categories','Basic categories','Basic categories','Basic categories',NULL),(778,180,2,'Jednostavne kategorije','Jednostavne kategorije','Jednostavne kategorije','Jednostavne kategorije','Jednostavne kategorije',NULL),(779,181,1,'Demo maps','Demo maps','','','',NULL),(780,181,2,'Demo maps','Demo maps','','','',NULL);

--
-- Table structure for table `payments`
--

DROP TABLE IF EXISTS `payments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `payments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date_paid` datetime DEFAULT NULL,
  `invoice_num` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `data_post` text COLLATE utf8_unicode_ci,
  `payer_id` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `txn_id` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `paid` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currency_code` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `payer_email` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `listing_id` int(11) DEFAULT NULL,
  `payment_gateway` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `package_id` int(11) DEFAULT NULL,
  `reservation_id` int(11) DEFAULT NULL,
  `saller_id` int(11) DEFAULT NULL,
  `property_id` int(11) DEFAULT NULL,
